// SPDX-License-Identifier: MIT 
pragma solidity >=0.5.0 <0.9.0;

contract User {

    struct Details {
        uint256 id;
        string wallet;
        uint256 coins;
        string name;
        string email;
        string phoneNumber;
        uint256 spent;
        string image;
        uint256[] purchases;
    }

    mapping(string => bool) private userEmailExists;
    mapping(string => Details) private userDetails; 
    mapping(string => string) private usedAddress ;
    Details[] public users;
    uint256 public nextUserId = 1;

    function isUserPresent(string memory email) public view returns (bool) {
        return userEmailExists[email];
    }

    function addUser(string memory _wallet, uint256 _coins, string memory _name, string memory _email, string memory _phoneNumber, uint256 _spent, string memory _image ) public returns (bool) {
        if (userEmailExists[_email]) {
            return false; 
        }
        uint256[] memory _purchases  ;

        users.push(Details(nextUserId, _wallet, _coins, _name, _email, _phoneNumber, _spent, _image, _purchases));
        userEmailExists[_email] = true;
        userDetails[_email] = Details(nextUserId, _wallet, _coins, _name, _email, _phoneNumber, _spent, _image, _purchases);
        usedAddress[_wallet] = _email ;
        nextUserId++;

        return true; 
    }
    function isuserpresent2(string memory _wallet) public view returns (bool) {
        return userEmailExists[usedAddress[_wallet]];
    }

    
    function getUserDetails(string memory _email) public view returns (Details memory) {
        return userDetails[_email];
    }

    
    function updateUserDetails(string memory _email, string memory _wallet, uint256 _coins, string memory _name, string memory _phoneNumber, uint256 _spent, string memory _image, uint256 _purchase) public returns (bool) {
        if(!userEmailExists[_email])
        {
            return false ;
        }
        userDetails[_email].purchases.push(_purchase);

        userDetails[_email] = Details(userDetails[_email].id, _wallet, _coins, _name, _email, _phoneNumber, _spent, _image, userDetails[_email].purchases);
        
        return true; 
    }


}
